(175, 362, 302, 'Ок, Вот ссылки:\n1) Сюда 200 лайков:\nhttp://vk.com/worldlink_now\n(к посту где ссылка на Worldlink-now.com, там уже 1 лайк есть)\n2) Сюда 200 лайков:\nhttp://vk.com/worldlink_now#/worldlink_now?z=photo-44092189_290457408%2Falbum-44092189_00%2Frev\nЭто картинка этого вордлинка, на неё тоже 200.\n\nПотом я оплачиваю киви и скажу куда остальные 600 сделать. В течении какого времени ждать 400 лайков?', 0, 0, '1352313230', '0'),
(176, 362, 302, 'Можно даже сделать лайки только на номер 1 для начала. Но мне нужно знать, как можно скорее, когда они будут сделаны, поскольку мне это нужно в течении суток (начать). Дайте знать, проинформируйте как можно скорее. Спасибо.', 0, 0, '1352357324', '0'),
(177, 302, 362, 'Всё, готово, лайки поставлены)\nТолько к первому посту вышло 400 лайков, но это за счёт того, что, видимо, второе изображение к нему &quot;привязано&quot;, поэтому лайки с двух постов там сплюсовались) ', 0, 0, '1352377555', '0'),
(178, 302, 362, 'Ещё там к постам кто-то из лайкеров один спам оставил, не забудьте удалить. Больше спама там не будет', 0, 0, '1352377672', '0'),
(179, 362, 302, 'Привет, спасибо.\nЕсть некоторые вопросы.\n1) Это собственные боты? Или аккаунты чужие? :)\nПоскольку они все однотипные конечно. И есть например юзер Ani, который видимо уже отвалился.\n2) Про спам я не понял. Можно скриншот? А то не вижу, в чём трабла.\n\nПопозже оплачу и скажу куда дальше слать.', 0, 0, '1352386487', '0'),
(180, 302, 362, '1. Это аккаунты, они не взломаны и рабочие.\n2. Я посмотрела &mdash; спама в комментариях уже нет, там просто какая-то девушка написала сообщение с ссылкой что-то типа: &quot;Проголосуйте за меня, пожалуйста&quot;. Я просто отметила &quot;это спам&quot;, видимо, уже удалили.', 0, 0, '1352387645', '0'),
(181, 362, 302, 'Заказ оплачен.\nЕщё лайки сюда:\n1) http://vk.com/cvetynizhniynovgorod\nна пост с розами - 143 лайка\nна второй пост &quot;Поскольку это наша новая группа, то...&quot; - 57 лайков.\nна самый нижний &quot;Хотите знать о специальных...&quot; - 20 лайков.\n\nЭто не затруднительно так распределять?\n2) http://vk.com/public42227180\n&quot;Статья о радиусных шкафах-купе&quot; - 150 лайков\n3) http://vk.com/rabotanizhniynovgorod\n&quot;Отправь тому, кто ищет работу или размести на стене - пусть задумаются!&quot; - 150 лайков;\n&quot;Чего же мне им написать о себе?&quot; - 80 лайков\n\nИтого вроде 1000.', 0, 0, '1352395972', '0'),
(182, 356, 302, 'Для начала хотелось бы услышать ответы на вопросы и в соответствии с полученной информацией, будут предложения.', 0, 0, '1352396155', '0'),
(183, 302, 356, 'Вокал для музыкальных произведений. \n1) Если у Вас есть идея по созданию музыкального произведения. Вам нужен вокал со словами/без слов. Тогда присылаете мне материалы: минусы, примеры вокала, тексты(на русском, возможны простые на английском). Я записываю вокал.\n2) Нужно перепеть какое-либо произведение. Ваши действия те же, что и в п.1', 0, 21, '1352455525', '0'),
(184, 302, 362, 'Спасибо, деньги получила. Вторую часть заказа на этих выходных будет выполнена.', 0, 0, '1352486887', '0'),
(185, 362, 302, 'Спасибо, жду. Буду рад продолжить сотрудничество.\nОднако не примите за назойливость, но мне хотелось уточнить происхождение аккаунтов, чтобы знать, для каких проектов их использовать. Это Ваши собственные аккаунты, которые Вы ведёте?\nТакже можете стукнуть в асю 122372', 0, 0, '1352538340', '0'),
(186, 356, 302, 'Давайте попробуем, только я в музыке не очень понимаю, минуса это что? Предложение такое для начала, перепеть песню &quot;розовые розы однокласснице моей&quot; - http://ktopoet.ru/node/650\nМузыка не важно, можете как в примере гитара, или может есть мелодия этой песни (это и есть минус?), на которую наложить слова. И это задание со смыслом. Смысл в том, что косвенно прорекламировать магазин цветов (розовые розы). Поэтому в тексте куплета, подумайте, как можно добавить слова &quot;розовые розы в магазине букетовград нижний новгород&quot; или &quot;я купил розовые розы для светки в магазине букетовград нижний новгород&quot;. Ключевые слова, которые нельзя выкидывать, это &quot;розовые розы, букетовград, нижний новгород&quot;. Если идей встроить текст нет, то в конце, можно просто добавить словами (но лучше пропеть, т.к. это можно сказать тестовое задание): &quot;Доставку розовых роз и других цветов по Нижнему Новгороду, Вы можете заказать в интернет-магазине БукетовГрад точка РФ или просто перейдите по ссылке рядом&quot;. ', 0, 0, '1352539616', '0'),
(187, 356, 302, 'При этом &quot;букетовград точка рф&quot; произнести максимально чётко, чтобы на слух прослушивающий мог с лёгкостью набрать адрес.\nЕсли возникнут уточняющие вопросы, то их лучше задать до выполнения задания )', 0, 0, '1352539692', '0'),
(188, 362, 302, 'Ещё увидел, что пишете статьи. Я как раз сейчас ищу исполнителя, кто может делать по 1500 слов или около 10000 знаков.', 0, 0, '1352557033', '0'),
(189, 302, 362, 'Нет, это не мои аккаунты, это реальные люди, поэтому ничего, кроме лайков они не дадут.\nНасчёт статьи ничего не могу гарантировать, но Вы ничего и не потеряете, оплата же после выполнения заказа) Можете прислать тему, пожелания и уточнить пр.подробности.? ', 0, 0, '1352624659', '0'),
(190, 362, 302, 'А технология какая по привлечению лайков? Потом эти реальные люди также реально значит могут отозвать свои голоса. Лайки ещё пока в процессе набора по текущему заказу?\n\nЧто касается статьи, почему без гарантий, вроде же заявку оставили ) Какие темы Вам интересны? Напишите, попробую подобрать что-то. Хотелось бы интересный эмоциональный обзор сделать.', 0, 0, '1352648771', '0'),
(191, 302, 356, 'Все готово, длительность 2 мин 36 сек. Вырезки в файле.', 0, 22, '1352808004', '0'),
(192, 356, 302, 'По вырезкам что-то не понять. В плане оплаты, на будущее, можете не сомневаться. Сотрудничаю долго и надёжно. Скажите куда оплачивать.\nИ да, если что-то не понравится в произведении, &quot;работа над ошибками&quot; возможна?', 0, 0, '1352935230', '0'),
(193, 302, 356, 'На самом деле с вырезками Я слукавил. Песню Я спел очень плохо. В нескольких местах мимо нот. Вынужден отказаться от этой и подобной работы. Слишком сложно для меня. Прошу прощения', 0, 0, '1352949094', '0'),
(194, 356, 302, 'Моя в шоке... дайте хоть послушать что вышло, пусть и мимо нот. Если приемлемо - оплачу.', 0, 0, '1352973496', '1'),
(195, 362, 302, 'Здравствуйте, есть новости?', 0, 0, '1352973975', '0'),
(196, 177, 302, 'Здравствуйте, подборка ссылок с комментариями актуальна?', 99, 0, '1352974207', '0'),
(197, 302, 177, 'Здравствуйте, давайте попробуем :)', 0, 0, '1352975438', '0'),
(198, 362, 302, 'Хочу разместить ещё один заказ на лайки и достаточно срочно нужно (первые 200 лайков нужно срочно). Сообщите о готовности выполнить.', 0, 0, '1353348144', '0'),
(199, 337, 302, 'Привет, нужно доставить 200 лайков на эту страницу:\nhttp://svit24.net/other/299-other/45713-vse-vyd-dyagnostyky-y-lechenyja-v-klynyke-assuta\nМожно так сделать(чтобы счётчик &quot;мне нравится&quot; показывал лайки)?\n\nИли нужно будет добавить страницу в сообщение вконтакте и уже там лайкать?', 0, 0, '1353412626', '0'),
(200, 302, 337, 'нужно будет добавить страницу в сообщение вконтакте и уже там лайкать\n', 0, 0, '1353416143', '0'),
(201, 367, 302, 'есть кто?', 0, 0, '1353441924', '0'),
(202, 337, 302, 'Страница http://vk.com/id147838060\nСамый свежий пост &quot;Все виды диагностики и лечения в клинике Ассута&quot;. Делайте пож-та 200 лайков и указывайте реквизиты оплаты.\nНо также проверьте, чтобы лайки показывались на странице http://svit24.net/other/299-other/45713-vse-vyd-dyagnostyky-y-lechenyja-v-klynyke-assuta\nПоставил лайк, вроде работает как надо. Всё, жду.', 0, 0, '1353442869', '0'),
(203, 302, 337, 'работает!!!\n\n130 руб.      сначала 60 руб. и после выполнение 70\n\nWebMoney: R290122849264\nЯ сделал 10 в подарок\nSkype: Ion5991', 0, 0, '1353451442', '0'),
(204, 302, 367, 'Есть. Пишите на почту. markavideo@yandex. К портрету можно пририсовать всё что угодно)', 0, 0, '1353477870', '0'),
(205, 309, 302, 'есть кто?', 0, 0, '1353513744', '0'),
(206, 362, 376, 'Добрый день! Мне необходимо перевести технический текст с английского на русский, возметесь?', 189, 0, '1353560427', '0'),
(207, 362, 376, 'ответьте на rs.nnov@mail.ru', 189, 0, '1353576805', '0'),
(208, 362, 376, 'по поводу лайков  на тоже мыло rs.nnov...', 190, 0, '1353580425', '0'),
(209, 362, 377, 'Здравствуйте! Мне нужен перевод текста для интернет-сайта, направленного на англо-язычных потребителей. Примерное кол-во знаков 7139.\n\nКакая будет стоимость? (Мне лучше будет в WMZ)\n\nСрок работы?\n\nБлагодарю!', 189, 0, '1353589306', '0'),
(210, 377, 362, 'Здравствуйте! \nВремя, затраченное на текст, зависит от его сложности.\nЦена: 100р., мне удобнее через платёжную систему Qiwi на кошелёк, там не нужно  регистрироваться, просто через терминал оплачиваете.', 0, 0, '1353594718', '1'),
(211, 142, 380, 'Добрый день,\nнеобходимо взять файл с \nhttp://www.flashmo.com/preview/flashmo_098_3d_curve_wall\nи внести небольшие изменения:\n1) убрать все текстовые надписи\n2) сделать прозрачный фон\n3) сделать так, чтобы при указании 6-8 элементов в xml-файле они корректно отображались в компоненте, в две строки по 3 или 4 элемента соответственно\n\nВы можете это сделать?', 85, 0, '1353872899', '1'),
(212, 165, 380, 'Добрый день,\nнеобходимо взять файл с\nhttp://www.flashmo.com/preview/flashmo_098_3d_curve_wall\nи внести небольшие изменения:\n1) убрать все текстовые надписи\n2) сделать прозрачный фон\n3) сделать так, чтобы при указании 6-8 элементов в xml-файле они корректно отображались в компоненте, в две строки по 3 или 4 элемента соответственно\n\nВы можете это сделать?', 93, 0, '1353873024', '1'),
(213, 165, 384, 'Это не обязательно должно стоить 100 рублей - цену можно обсудить. Нужна таблица во Flash с цифрами от 0 до 100. Чётные цифры &ndash; чёрным цветом, нечётные &ndash; малиновым. Цифры должны быть красивыми, желательно &laquo;глянцевыми&raquo; и &laquo;выпуклыми&raquo;.\nЦвет фона &ndash; для чётных десятков &ndash; голубой, для нечётных &ndash; жёлтый. Числа должны быть разделены между собой вертикальными разделителями тёмно-синего цвета. Ряды тоже должны быть разделены друг от друга.\nНад числами должны быть десятки кружочков. Количество закрашенных кружочков должно соответствовать цифре сверху. Т.е. над числом 4 должно быть 4 закрашенных кружочка и 96 пустых (белых с чёрным контуром). Закрашенные кружочки тоже должны быть красивыми, напоминающими глянцевый шар. Нужен во флеш с возможностью редактирования. Лучше обсудить задание через скайп: vovablacksea.', 93, 0, '1354560258', '1'),
(214, 165, 384, 'Файлик образца не вставляется...\n', 93, 0, '1354562044', '1'),
(215, 165, 384, 'Собственные сообщения редактировать невозможно? Сообщил скайп, оказывается - нельзя и отредактировать - никак... Сделайте возможность редактирования хотя бы собственных сообщений. И ещё - файлы прицепить нельзя...\n', 93, 0, '1354565871', '1'),
(216, 359, 388, 'вот сделай телефон 89101392871', 185, 23, '1354982717', '0'),
(217, 167, 396, 'скинь мне свою страничку в контакте', 96, 0, '1355731930', '1'),
(218, 391, 397, 'Здравствуйте! Скажите, можно посмотреть на ваши работы?', 210, 0, '1355928313', '0'),
(219, 309, 397, 'Здравствуйте! как сделать вам заказ?', 151, 0, '1355930608', '1'),
(220, 397, 391, 'Здравствуйте! Например вот - http://stawitsky-studio.ru/', 0, 0, '1355969371', '1'),
(221, 318, 398, 'за 100 рублей?', 165, 0, '1356206630', '1'),
(222, 402, 302, 'Здравствуйте, какой длины текст Вы переводите за 100?\nА также сколько можете делать в сутки и в месяц.\nИ Ваша стоимость работы за сутки и в месяц?', 213, 0, '1357072405', '0'),
(223, 391, 302, 'Здравствуйте, покажите примеры сайтов за 100.', 210, 0, '1357072459', '1'),
(224, 391, 302, 'А также любопытно по монтажу ролика. Есть постоянно и периодически работа, но с англоязычными роликами.', 205, 0, '1357072800', '1');
INSERT INTO `inbox` (`MID`, `MSGTO`, `MSGFROM`, `message`, `PID`, `FID`, `time`, `unread`) VALUES
(225, 302, 402, 'За 100 руб перевожу до 1000 зн(это пол-листа),если объем больше, то считаю по страницам- один лист 200 руб(считаю по готовому переводу, а не по заказу)\nЗа один день делаю 6 страниц.\nНе измеряла стоимость работы в сутки и в месяц, так как работаю по объемам(то есть работа, то нет)', 0, 0, '1357107434', '0'),
(226, 391, 409, 'Здравствуйте! Мне нужен логотип для сайта по обучению плиточным работам. ', 209, 0, '1357146247', '1'),
(227, 402, 302, 'К сожалению это очень дорого.\nЕсть предложение делать &quot;быстрые переводы&quot;, когда статья вводится в онлайн переводчик и быстренько редактируется руками и головой, чтобы был читаемый текст на выходе. Оплачивать готов по 10 руб 1000зн. Работы много.', 0, 0, '1357169828', '0'),
(228, 302, 402, 'Если тематика не сложная и нет спец. терминов, то почему бы и нет. Сделаю', 0, 0, '1357185061', '0'),
(229, 402, 302, 'Здравствуйте, давай попробуем.\nДля начала знаков на 5000-10000 знаков (одну или несколько статей). Возьмём тему handmade.\nЭто нормально? Какие вообще темы предпочтёте?\nНапомню, смысл обработки последующий, чтобы статья нормально читалась человеку и была уникальной. Буду ждать, сообщите примерно сколько времени потребуется.', 0, 0, '1357229907', '0'),
(230, 302, 402, 'Так тексты я ищу сама по интернету? Ого. ', 0, 0, '1357230874', '0'),
(231, 402, 302, 'Ну да, а разве это сложно? нашли какой-нибудь сайт или блог по тематике handmade и переводите указанным способом. Я конечно могу Вам найти, это несложно, но на будущее лучше самостоятельно.\n\nВот Вы мне кстати скажите, работая с контентом, какая сумма в месяц Вас устроит? Я вам кое-что расскажу потом. Ну т.е. напишите достойную оплату по вашему мнению, которую вам будет хватать.', 0, 0, '1357241706', '0'),
(232, 302, 402, 'O, так мне много надо :-) Переводы-это только подработка. У меня задача, или верней цель- в день 1000 руб. Не важно с какого вида деятельности. \nТак давайте, рассказывайте сейчас, а то заинтриговали и не говорят ничего. Хм', 0, 0, '1357270654', '0'),
(233, 402, 302, 'Подскажите асю, я вам там расскажу.', 0, 0, '1357299121', '0'),
(234, 302, 402, '650934357', 0, 0, '1357301526', '0'),
(235, 302, 402, 'она у меня не работает оказывается, вот новый номер: 651426032', 0, 0, '1357303001', '0'),
(236, 104, 18, 'Здравствуйте, dimafoto!\n\nУкажите пожалуйста WMID, чтобы вывести деньги.\n\nСпасибо большое!', 0, 0, '1359120555', '1'),
(237, 55, 419, 'Здравствуйте!\nЕсть задание на английском, связано с операционными системами, нужно исполнить на джаве. аська 616840377', 25, 0, '1359651837', '1'),
(238, 402, 420, 'Здравствуйте меня интересует перевод электронных книг', 213, 0, '1359821372', '0'),
(239, 420, 402, 'к сожалению сейчас занята, у меня много заказов на месяц вперед.', 0, 0, '1359894926', '0'),
(240, 362, 420, 'Меня интересует перевод электронных книг', 189, 0, '1360044461', '0'),
(241, 420, 362, 'Добрый вечер!\nМожете прикрепить файл в архиве в сообщении, чтобы я точно сказала, смогу ли я взяться за перевод?', 0, 0, '1360075128', '0'),
(242, 362, 420, 'Дорогой друг, на этом сайте Вы можете сами выбрать удобную для Вас тематику. Все книги скачиваются бесплатно и без регистрации.Сообщите мне, какая тема для Вас ближе.http://www.bugabong.com/', 0, 0, '1360076201', '0'),
(243, 420, 362, 'Что ж, можно будет сделать так: я выбираю книгу =&gt; мы договариваемся о цене и времени =&gt; я присылаю перевод в формате doc =&gt; вы оплачиваете =&gt; затем я снова выбираю книгу.\nДля начала я переведу эту книгу: http://www.bugabong.com/technology/twitter-white-knight.html &mdash; размер 46стр. Какая цена Вас устроит и сколько времени дадите приблизительно?', 0, 0, '1360087769', '0'),
(244, 398, 429, 'Здравствуйте! Уточните, пожалуйста, какой по объему текст Вы готовы перевести за 100 руб. ', 212, 0, '1362992684', '1'),
(245, 362, 429, 'Добрый день! Уточните, пожалуйста, какой объем и за какую сумму Вы готовы переводить. Одинакова ли эта сумма для перевода с английского / на  английский?', 189, 0, '1363008382', '0'),
(246, 170, 429, 'Здравствуйте! Уточните, пожалуйста, что вы подразумеваете под &quot;листом&quot;. Какой объем в знаках за какую сумму Вы готовы переводить? ', 97, 0, '1363008586', '1'),
(247, 28, 429, 'Здравствуйте! Уточните, пожалуйста, какой объем в знаках Вы готовы переводить и за какую сумму (с английского, на английский). ', 90, 0, '1363008749', '1'),
(248, 429, 362, 'Здравствуйте!\nСумма за 10 страниц &mdash; 100 рублей, и также за 5 страниц технического текста.\nЯ могу взяться за перевод художественных текстов большой величины, но на технические тексты особо времени сейчас не хватает, если они большого объёма (берусь до 10 страниц или около того).\nСумма одинакова для перевода на английский и обратно.\n', 0, 0, '1363029053', '0'),
(249, 102, 431, '   Нужна помощь по оптимизации кода сайта исправления ошибок, правка, совет. Сколько?\n  Заранее благодарен.\n\n  maxoshovsky@gmail.com', 59, 0, '1363187659', '1'),
(250, 362, 429, 'Здравствуйте! А если я Вас попрошу не перевод сделать, а переделать небольшую табличку на английском, на полторы страницы Word, и внести в нее дополнительную информацию, за 100 руб, вы сделаете это сегодня? ', 0, 0, '1363602630', '0'),
(251, 188, 429, 'Здравствуйте! А если я Вас попрошу не перевод сделать, а переделать небольшую табличку на английском, на полторы страницы Word, и внести в нее дополнительную информацию, за 100 руб, вы сделаете это сегодня?', 102, 0, '1363602889', '0'),
(252, 429, 362, 'Хорошо) Только это вечером будет, ближе к ночи, ибо я после работы только в половине десятого прихожу.\nКидайте сюда файл и подробности, что именно нужно переделать/добавить и т.д.\nБыло бы удобнее, если бы деньги Вы кинули на киви-кошелёк, в течение недели где-то, вот его номер:  952 956 59 72', 0, 0, '1363605334', '0'),
(253, 362, 429, 'Чтобы Вам было проще и понятнее, постараюсь описать все максимально подробно. \nВ архивной папке Вы найдете документ Word под названием Nomination forms - Summary. В нем - таблица, которую нужно переделать и данные из которой нужно использовать. Из этой одной таблицы нужно сделать две (два разных файла) по образцу таблицы в документе ESC_GA09_nominations. В первой из них должны быть кандидаты на должности президента, вице-президентов, членов президиума, аудиторов и председателей комитетов (Technical Committee и Press &amp; Promotion Committee). Во второй - кандидаты на должности членов комитетов, подкомитетов и антидопинговых сотрудников (Anti-Doping Officers). Последний столбец  в образце - Remarks - не нужен. Таким образом, будет 5 столобцов. Подразделение (President, Presidium members и т.д.) нужно указать в строке  (в образце выделено красным), только по центру таблицы, ячейки в этой строке объединить. В исходной таблице приведено полное название федерации. ...', 0, 26, '1363612876', '0'),
(254, 362, 429, '... В новых должна быть указана аббревиатура (столбец Nation). Соответствие аббревиатур федерациям можно посмотреть по этой ссылке http://www.issf-sports.org/theissf/organisation/member_federations.ashx?continent=europe&amp;contlinkid=200 (поиск - Ctrl + F). Пол кандидата и дату его рождения можно посмотреть в анкетах. Обратите внимание, в одном файле может быть несколько анкет. В графе Note нужно указать, переизбирается ли кандидат (New/Re-election). Понять это можно, перейдя по ссылке http://www.esc-shooting.org/main/info/officers.htm , где указано, кто какую должность занимает в настоящее время. Заголовки над таблицами можете не писать. Таблицы пришлите, пожалуйста, в формате Word. \nСпасибо! Оплату произведу, как Вы просили. ', 0, 0, '1363612887', '0'),
(255, 429, 362, 'У Robert Loughridge анкета неполная &mdash; нет даты рождения.', 0, 29, '1363674075', '0'),
(256, 429, 362, 'Вот вторая таблица', 0, 30, '1363674092', '0'),
(257, 362, 429, 'Спасибо за помощь. Я вчера положила деньги на Ваш кошелек. Проверьте, пожалуйста. ', 0, 0, '1363850155', '0'),
(258, 362, 429, 'Axennie, возьметесь за перевод 10 страниц текста с английского на русский? Текст несложный, я дам список слов, которые, возможно, будут непонятны. И перевод подобного текста для примера (там частично совпадают некоторые заголовки, имена и т.д. - можно взять за образец). Не нужно переводить совсем дословно - должно хорошо читаться по-русски. Прислать можно завтра - послезавтра. ', 0, 0, '1363852626', '0'),
