(269, 429, 435, 'Добрый день! Ок, без проблем. Присылайте. Только подскажите пожалуйста, а как здесь производится оплата? Просто я впервые именно на этом сайте..', 0, 0, '1364278529', '0'),
(270, 435, 429, 'Если есть возможность, сделайте, пожалуйста, сегодня до вечера. Если нам понравится друг с другом работать, я буду периодически к Вам обращаться (обычно тексты меньшего объема). Оплата, как я поняла, на сайте не предусмотрена. Если у Вас есть qiwi-кошелек, могу перевести деньги на него. Так, наверное, будет быстрее. Если нет, зарегистрироваться можно здесь https://www.qiwi.ru/register/form.action Или предлагайте свои варианты. ', 0, 35, '1364279375', '0'),
