(286, 185, 453, '89851001339 89671672202 татьяна', 117, 0, '1365753258', '1'),
(287, 435, 429, 'Лиза, здравствуйте! Поможете с таблицей? Нужно данные с этой страницы http://www.issf-sports.org/theissf/organisation/member_federations.ashx?continent=europe&amp;contlinkid=200 перенести в таблицу Excel. В основном, процедура - copy-paste. Плюс со страницы http://www.esc-shooting.org/index.php/informations/addresses-federations сохранить логотипы федераций в папке и  названия этих фотографий также прописать в таблице. Это тоже просто. Если согласны, пришлю таблицу с примером и распишу все подробнее. ', 0, 0, '1366022188', '0'),
