(293, 435, 429, 'Договорились.', 0, 0, '1366094364', '0'),
(294, 429, 435, 'Добрый день! У меня возникла проблема с вашим заданием.. Я сохранила выполненный файл Excel в исходном архиве, но при повторном открытии он выдает мне предыдущую, невыполненную версию Вашего задания.. Пыталась искать сохраненный файл, но он везде его открывает только в первоначальном виде.. В общем так получилось, что из выполненной работы у меня только файл с логотипами..', 0, 0, '1366196519', '0'),
(295, 435, 429, 'Добрый день! В архиве нельзя ничего сохранять, Вам нужно было извлечь файл из архива и уже с ним работать. Честно говоря, мне даже в голову не пришло, что Вы можете не уметь работать с архивными файлами. Но, в какой-то степени, это и моя ошибка, мне нужно было это предусмотреть. Поэтому предлагаю сделать так: я Вам плачу еще 100 рублей, а Вы сделайте, пожалуйста, таблицу. Если не умеете извлекать из архива, я пришлю Вам таблицу отдельно еще раз. Договорились? ', 0, 0, '1366200740', '0'),
(296, 429, 435, 'Да нет, это в принципе моя ошибка. Не знаю, почему мне не пришло в голову пересохранить.. Если я сделаю это только к завтрашнему вечеру? Ничего страшного?', 0, 0, '1366202587', '0'),
(297, 435, 429, 'Хорошо, давайте к завтрашнему вечеру. ', 0, 0, '1366204271', '0'),
(298, 435, 429, 'Извлечь файл из архива можно обычным перетаскиванием. Или нажав на кнопку сверху &quot;Извлечь все файлы&quot;. Архивную папку можно удалить, потому что в нее уже ничего сохранить нельзя. А чтобы заархивировать файлы, можете создать папку и скинуть туда таблицу и папку с логотипами. А потом на эту папку нажать правой кнопкой мышки и выбрать &quot;добавить в архив&quot; или &quot;add to archive&quot; и нажать ОК. И уже эту сжатую папку можно спокойно отправлять. ', 0, 0, '1366204764', '0'),
(299, 429, 435, 'Спасибо! Я вроде уже разобралась. Завтра днем все пришлю.', 0, 0, '1366206427', '0'),
(300, 429, 435, 'Доброе утро! Прошу прощения за вчерашнюю накладку. Надеюсь теперь все ок. Насчет оплаты - предлагаю как в прошлый раз. Тот же номер телефона.', 0, 39, '1366267080', '0'),
