(305, 391, 473, 'Здравствуйте,надо создать сайт для фирмы.\nперезвоните мне пожалуйсто или дайте свой номер.\n89130947547         horoshilova82@bk.ru', 210, 0, '1369760543', '1'),
(306, 240, 481, 'Здравствуйте! Нужно отредактировать и поменять на один фон фотографии моего мыла на продажу! Ваши варианты и цены? Около 40 шт! Просмотрите и приведите пример из моих фоток в контакте! Спасибо!', 125, 0, '1370645864', '1'),
(307, 163, 483, 'Добрый день, вы пишете программы на scilab?', 91, 0, '1370976296', '0'),
(308, 77, 484, 'пытаюсь связаться, хотя не знаю как это здесь делается', 40, 0, '1371022882', '0'),
(309, 483, 163, 'Да.\nВремени сейчас не много, так что зависит от сложности.', 0, 0, '1371049387', '0'),
(310, 163, 483, 'Вот задание под номером 26, нужно сделать до пятницы вечера, это реально?', 0, 40, '1371060449', '0'),
(311, 483, 163, 'К сожалению нет.\nЗадание часа на 2 (гуи нарисовать и подключить работу с картинками - два внешних плагина, могут быть проблеммы). Могу сделать на выходных, если еще будет актуально.', 0, 0, '1371150549', '0'),
(312, 306, 486, 'Здравствуйте,решаете задачи по ООП?\nЗадание: создать с помощью С++ Builder удаленный сервер автоматизации, включить клиентскую часть ActiveX в HTML страницу. В объект ActiveX поместить собственную компоненту построения графика заданной функции с настраиваемыми в Инспекторе Объектов цветом линии, координатами расположения, видимостью и коэффициентами функции.\nКлиент должен иметь возможность указать диапазон значений оси X и коэффициенты указанной функции. Расчетные значения для построения графика должны рассчитываться на удаленном сервере и передаваться клиентскому объекту.\n', 146, 0, '1371212359', '1'),
(313, 306, 486, 'И есть еще одна работа,по периферийным устройствам, разработать драйвер клавиатуры для выполнения особых функций. Выполнить работу нужно за короткий срок.', 146, 0, '1371212552', '1'),
(314, 359, 486, 'задачи по ООП решаете? ', 185, 0, '1371213624', '0'),
(315, 486, 359, 'да', 0, 0, '1371215696', '0'),
(316, 486, 359, 'присылайте условие', 0, 0, '1371215730', '0'),
(317, 163, 483, 'На выходных будет актуально. В архиве уже есть кусок программы, я создал форму в guibuilder и почти завершил работы с кнопкой Open(она выводит только в формате jpeg, нужно еще сделать tiff и bmp). Также в архиве есть картинки для примеров.\nНа счет оплаты: какую сумму перевести, и переводить ее в системе или другим способом?(просто я в первый раз здесь)', 0, 41, '1371224900', '0'),
(318, 483, 163, 'полтора дня убил на отображение картинок в uicontrole - не получилось. Ситуация грустная. Для нормальной работы с изображением его надо прочитать в переменную. Собственно ipd или sivp это делают без проблем. Через imread я могу прочитать любой из тестовых файлов. Далее работаю с этой переменной как с матрицей размерности x,y,3 - где х и у координаты точки, а 3 - три компоненты в ргб. Там изменить яркость - вопрос алгоритма (просто гонять компоненту или считать общую яркость и плясать от этого). \nЕсть очень некрасивый выход - через imwrite записывать файл на дис и потом его показывать во втором контроле. Работать будет крайне медленно, т.к. при каждом изменении ползунка будет запись/считывание временного файла. Какой именно алгоритм работы с яркостью от вас хотят увидеть? Какие есть варианты решения проблемы отображения картинки в контроле? П.С. imshow() показывает картинки из переменной без вопросов. ', 0, 0, '1371398739', '0'),
(319, 163, 483, 'У меня уже у самого все получилось, я думал вы не стали заниматься программой, так как я не получил ответа', 0, 0, '1371398997', '0'),
(320, 483, 163, 'Старею))\nРад, что получилось все самостоятельно.\nЕсли есть возможность - хотелось бы посмотреть на решение.\nП.С. У меня в скайлабе обнаружилась интересная трабла с путями файлов, содержащих не символы англ. алфавита или цифры. Он их просто игнорировал. До обновления такого не было. При сдаче лучше учесть.', 0, 0, '1371399658', '0'),
(321, 163, 483, 'Вот программа, конечно не идеально получилось, надеюсь зачтут.\nНа счет пути файла, я тоже обнаружил этот баг, и преподаватель нам про него говорил', 0, 42, '1371400672', '0'),
(322, 304, 489, 'Готов взяться за вашу работу!', 0, 0, '1371863610', '1'),
(323, 263, 489, 'Готов взяться за вашу работу!', 0, 0, '1371863672', '1'),
(324, 501, 510, 'Здравствуйте, Максим, у меня есть сайт http://russiaitalia.weebly.com/ по которому мне нужна помощь. Мне нужны объявления и статьи. Объявления по темам страниц, статьи в блог там же. Оплата по количеству  эффективных знаков статьи. Или по количеству объявлений. Я сама копирайтер, просто мне нужна помощь. Если Вы можете мне помочь, напишите мне на liudmila эт russianitalian точка ком. Боюсь, что система не пропустит адрес, поэтому пишу так. ', 269, 0, '1375296824', '0'),
(325, 510, 501, 'Добрый вечер, Людмила. \nСразу к делу. Я готов к сотрудничеству, если Вас устроят мои расценки. Копирайт, то есть живой текст, на сто процентов уникальный и интересный людям - 100 рублей за тысячу знаков. Рерайт, глубокий и так же уникальный - 60 рублей килознак. Кроме того, возможен SEO - копирайтинг. Цена - 150 рублей килознак. \nЭто мои условия. Если Вы согласны, начинаем сотрудничать.\n С уважением, А. М.', 0, 0, '1375299031', '1'),
(326, 225, 511, 'на какую тему нужна песня?', 0, 0, '1375735155', '1'),
(327, 362, 429, 'Axennie, добрый день! Возьметесь за 200 рублей перевести 9 страниц текста? Текста даже меньше, т.к. это таблицы. Тематика - стрелковый спорт. Перевод нужно прислать завтра в первой половине дня. Только перевод должен иметь смысл, электронный переводчик здесь не подойдет. Я пришлю список с переводом некоторых спортивных терминов, которые могут встречаться. Что скажете? ', 0, 0, '1375776324', '0'),
(328, 503, 429, 'Добрый день! Возьметесь перевести 3 файла, в сумме на 9 страниц? Текста даже меньше, т.к. это таблицы. Тематика - стрелковый спорт. Перевод нужно прислать завтра в первой половине дня. Только перевод должен иметь смысл, электронный переводчик здесь не подойдет. Я пришлю список с переводом некоторых спортивных терминов, которые могут встречаться. Что скажете?', 270, 0, '1375776525', '1'),
