(349, 501, 302, 'Вы пишите текст или добавляете видео. За каждые 1000 просмотров материала, начисляется 30 рублей. Вывод от 100 рублей. Можно статьям помогать набирать посещалку, например анонсируя в социалках и т.п.', 0, 0, '1377518139', '1'),
(350, 302, 493, 'http://vk.com/wall32329411_53876\nЗдравствуйте, например вот.', 0, 0, '1377523597', '0'),
(351, 493, 302, 'Приветствую, попробуем? )\nПредложение такое для начала, перепеть песню &quot;розовые розы однокласснице моей&quot;\nИ это задание со смыслом. Смысл в том, что косвенно прорекламировать магазин цветов (розовые розы). Поэтому в тексте куплета, подумайте, как можно добавить слова &quot;розовые розы в магазине букетовград нижний новгород&quot; или &quot;я купил розовые розы для светки в магазине букетовград нижний новгород&quot;. Ключевые слова, которые нельзя выкидывать, это &quot;розовые розы, букетовград, нижний новгород&quot;. Если идей встроить текст нет, то в конце, можно просто добавить словами (но лучше пропеть, т.к. это можно сказать тестовое задание): &quot;Доставку розовых роз и других цветов по Нижнему Новгороду, Вы можете заказать в интернет-магазине БукетовГрад точка РФ или просто перейдите по ссылке в описании&quot;.\nЧто скажете, как будет лучше сделать?', 0, 0, '1377563529', '1'),
