(381, 306, 548, 'Здравствуйте, Алексей) Мне очень нужна помощь по программированию на С++. Задание следующее:\nСоздать класс СТРОКА, реализующий текстовую строку. То есть хранит цепочку символов переменной длины, позволяет определить её длину, поддерживает операцию конкатенации и сравнения двух строк. Составить примеры использования и набор тестов.\nРазработать и реализовать класс на базе класса СТРОКА для решения задачи по варианту. Написать пример программы использования класса. Это общее задание, а индивидуальное : 9.	Создать класс БИТОВАЯ_СТРОКА. Строки данного класса могут содержать только символы ''0'' и ''1''. Если в составе инициализирующей строки будут встречены любые символы, отличные от допустимых, БИТОВАЯ_СТРОКА принимает нулевое значение. Добавить возможность заполнения значения строки из числа в шестнадцатеричной системе. Возьметесь ли вы за него, и как мне перевести вам сумму за его выполнение? Заранее спасибо)\n', 146, 0, '1381368070', '1'),
