INSERT INTO `posts` (`PID`, `USERID`, `gtitle`, `gtags`, `gdesc`, `ginst`, `category`, `days`, `youtube`, `feat`, `time_added`, `date_added`, `active`, `last_viewed`, `rating`, `viewcount`, `pip`, `p1`, `p2`, `p3`, `price`, `rev`, `ctp`, `short`) VALUES
(14, 30, 'переведу с белорусского на русский и наоборот', 'перевод текст белорусский русский язык', 'Я переведу любой текст с белорусского на русский и наоборот!\r\nДо 1000 знаков.', 'Текст!', 30, 1, '', 0, '1301776712', '2011-04-02', '1', '', 0, 2172, '46.56.169.4', '14-1.jpg', '', '', 100, 0, 20, '19704'),
(18, 41, 'спою песню и запишу это на видео', 'песня музыка видео подарок', 'Спою любую песню и запишу это на видео', 'Название песни', 23, 1, '', 0, '1301857678', '2011-04-03', '1', '', 0, 2259, '178.120.58.82', '18-1.jpg', '', '', 100, 0, 20, '19937'),
(19, 44, 'сочиню для Вас или Ваших друзей песню на гитаре', 'песня подарок гитара', 'Могу сочинить песню на любую тематику. Как вариант - кавер на уже существующую.', 'От Вас необходима тема.', 16, 3, '', 0, '1301901073', '2011-04-04', '1', '', 0, 2709, '86.57.158.78', '19-1.jpg', '', '', 100, 0, 20, '20081'),
(12, 29, 'сделаю Вам видос из Ваших фотографий', 'видео подарок презент воспоминание ', 'Из ваших фотографий и видео сделаю оригинальный клип исходя из Ваших пожеланий', 'Вышлите мне пожлауйста свои фотографии или видео!', 23, 1, '', 0, '1301775253', '2011-04-02', '1', '', 0, 2005, '46.56.169.4', '12-1.jpg', '', '', 100, 0, 20, '19853'),
