(111, 195, 'отправлю волшебное письмо по всему миру', 'подарок сказки конверты', 'Всего за 99р. я отправлю волшебное письмо со сказкой для взрослого человека (не пошлое, не порно) - о любви. Вы сможете таким образом поделиться своими чувствами с теми кто далеко. Письмо содержит оригинальную сказку с не менее оригинальной иллюстрацией, напечатанными на дизайнерском картоне. Письмо отправляется в течении 3 дней с момента заявки, а вам я сообщаю трекинг-номер для отслеживания письма через интернет', '1. Полное ФИО получателя, полный адрес доставки включая индекс.\r\n2. Можно дописать небольшое пожелание от вашего имени - я приложу его к письму. (Постарайтесь уложиться в 20-30 слов:)\r\n\r\nПосле отправки я сообщаю трекинг номер посылки, который позволит вам отследить доставку через официальные почтовые сайты. Срок доставки зависит от сезонной загруженности почты и, разумеется страны, в которой проживает адресат. Собственно дальше все зависит уже от по', 16, 3, 'http://www.youtube.com/watch?v=rqKpxF4bVT0', 0, '1315083032', '2011-09-03', '1', '', 0, 2185, '94.244.61.45', '111-1.png', '', '', 100, 100, 20, '119862'),
(112, 200, 'На Днюху, на праздник, на ЮБИЛЕЙ, сочиню поздравление ВСЕГО', 'Стихотворное поздравление', 'Время исполнения от часа до суток.\r\nОперативно, индивидуально, красиво,  весело и адекватно.\r\nОт четырёх до шестнадцати строк.', 'От Вас кому, когда, повод поздравления, желаемо-присутствующие слова и т.д.', 16, 1, '', 0, '1315780664', '2011-09-11', '1', '', 0, 1920, '91.215.122.79', '112-1.jpg', '', '', 100, 0, 20, '127204'),
(114, 200, 'Воспитаю, Присмотрю за Вашей Обезьянкой. От суток до года ВСЕГО', 'Воспитание, приматы, сиделка, няня, обезьяны', 'Обучу её весёлым танцам, стучать в барабан или бубен, гонять на велосипеде и открывать перед вами двери.', 'Познакомить с обезьяной в домашней, дружественной обстановке. \r\nС щедростью оплачивать счета из ресторанов, Мак Дональдсов и зоопарков.', 33, 1, '', 0, '1315784313', '2011-09-11', '1', '', 0, 2011, '91.215.122.79', '114-1.jpg', '', '', 100, 0, 20, '127427'),
(139, 66, 'наращу вам ногти (качественно и недорого)', 'ногти услуги красота наращивание ', '● Наращивание ногтей на формы \r\n● Покрытие ногтей гелем\r\n● Укрепление ногтей биогелем\r\n● Коррекция \r\n● Исправление ошибок (перенаращивание)\r\n● Ремонт\r\n● Снятие гелевых ногтей\r\n● Маникюр\r\n● Запечатывание ногтей\r\n● Возможен выезд на дом ', 'Подписывайтесь на паблик и следите за обновлениями\r\nhttp://vk.com/nail_minsk', 33, 1, '', 0, '1329856622', '2012-02-21', '1', '', 0, 1859, '46.53.195.15', '139-1.jpg', '139-2.jpg', '139-3.jpg', 100, 0, 20, '255771'),
