(117, 185, ' помогу с английским языком', 'английский язык, перевод, контрольная, курсовая, дипломная, консультация', 'Проблемы с английским? Не беда! Я помогу тебе с любым заданием: будь -то перевод, контрольная, курсовая, дипломная или тебе просто нужен совет. Не стесняйся, спрашивай!', 'пришлите текст для перевода или текст контрольной работы', 29, 1, '', 0, '1317974340', '2011-10-07', '1', '', 0, 1996, '95.134.125.120', '117-1.jpg', '', '', 100, 100, 20, '147140'),
(118, 216, 'сделаю шрифт, имитирующий ваш почерк', 'подарок, шрифт, приколы, ученику', 'Необычный подарок дорогому вам человеку. Шрифтом можно пользоваться в ворде и т.п. Не хотите писать конспекты от руки? Тогда просто распечатайте нужный текст своим собственным шрифтом.\r\nЕсли надо сымитировать чужой почерк, то присылайте сканы конспектов/записей человека, чтобы собрать из них необходимые буквы.\r\n', 'От вас нужен скан написанных на белом листке всех заглавных букв алфавита, написанных рукой, текст &quot;съешь же ещё этих мягких французских булок, да выпей чаю&quot; прописными, а также цифры от 0 до 9 и знаки \r\n! &quot; № ; % : ? * ( ) _ + - = \\ / &lt; &gt; ~ @ # $ ^ &amp; | '' . , \r\nБуквы должны быть на белом фоне, а не на листах в линейку или клетку, явно отличаться по цвету от фона.', 16, 4, '', 0, '1318239596', '2011-10-10', '1', '', 0, 3847, '178.94.22.233', '118-1.jpg', '', '', 100, 100, 20, '148687'),
(119, 216, 'нарисую портрет', 'портрет, подарок, рисунок', 'Нарисую чб портрет карандашом по вашей фотографии. Размер А5. Скан портрета отправлю вам на почту. \r\nВам останется лишь распечатать портрет, вставить в рамку и подарок готов! Распечатанный вариант на глаз почти не отличается от карандашного рисунка.\r\nРисую быстро (не фотошоп). Скорость зависит от кол-ва заказов.', 'От вас нужна фотография, где видно лицо человека хорошего разрешения. Желательно поконтрастнее.', 16, 4, '', 0, '1318240124', '2011-10-10', '1', '', 0, 2336, '178.94.22.233', '119-1.jpg', '119-2.jpg', '119-3.jpg', 100, 0, 20, '148686'),
