(189, 362, 'переведу текст с английского/с английского на русский', 'Перевод', 'Переведу любой текст (литературный/технический) как с английского языка на русский, так и с русского на английский. Размер текста: до 10 страниц.', 'Пожалуйста, пришлите мне материал, который нужно перевести.', 33, 1, '', 0, '1350995551', '2012-10-23', '1', '', 0, 1969, '46.72.233.109', '189-1.jpg', '', '', 100, 0, 20, '1748751'),
(190, 362, 'помогу набрать до 1000 лайков в контакте', 'Лайки, мне нравится, вконтакте, соцсети, популярность, реклама', 'Всего за 1 день с моей помощью Вы можете набрать 1000 лайков к любой записи в контакте. Также, можно сделать так: 100 лайков к 10ти записям и т.д.', 'Для этого необходимо прислать мне ссылки с объектами, к которым нужно получить лайки.', 33, 1, '', 0, '1350996056', '2012-10-23', '1', '', 0, 4132, '46.72.233.109', '190-1.jpg', '', '', 100, 0, 20, '1748750'),
(191, 362, 'помогу сделать заказ в интернет-магазине', 'Ebay, PayPal, Qiwi, покупки, etsy, интернет-магазины', 'Не можете разобраться c Ebay или PayPal? Не знаете, где найти аналогичный товар за меньшую цену или сомневаетесь, стоит ли доверять этому источнику в качестве продукции? Вы вообще никогда раньше не совершали покупки через интернет? Я помогу разобраться, качественно проведу инструктаж, в общем, не подведу)', 'Нужно уточнить, что именно Вы хотите заказать через интернет или прислать фотографию/название вещи, которую Вы бы хотели заказать, да не можете найти, уточните стоимость товара, которая бы Вас устроила.', 29, 1, '', 0, '1350996728', '2012-10-23', '1', '', 0, 1161, '46.72.233.109', '191-1.png', '', '', 100, 0, 20, '1748749'),
(192, 362, 'обработаю 3 любых фотографии/изображения', 'Photoshop, обработка изображений', 'Ретушь, добавление спецэффектов, эффект &quot;красных глаз&quot;, комплексное улучшение, устранение нечёткости, замена фона или одежды, макияж фотографии, добавить знаменитость, улучшить внешность, создание анимации из фотографий/изображений и мн.др.', 'Необходимо прислать изображения в наилучшем качестве, укажите пожелания к ним. ', 22, 1, '', 0, '1350997462', '2012-10-23', '1', '', 0, 1424, '46.72.233.109', '192-1.png', '', '', 100, 0, 20, '1748748'),
(193, 362, 'помогу изменить свою внешность к лучшему', 'Красота, самосовершенствование, совет', 'Даю оценку общему внешнему виду.\r\nДам совет по поводу причёски, фигуры, стилю и пр., подскажу, как Вам будет лучше, над чем стоило бы поработать и как этого достичь. Будьте красивыми)', 'Необходима Ваша фотография, желательно несколько: крупным планом и в полный рост, без фотошопа и нормального качества/чёткая.', 29, 1, '', 0, '1351002797', '2012-10-23', '1', '', 0, 2191, '46.72.233.109', '193-1.jpg', '', '', 100, 0, 20, '1748746'),
(194, 362, 'переписываюсь с кем-либо на любую тему', 'Переписка, шпионаж, общение.', 'Выполняю самые циничные просьбы.\r\nХочешь разыграть знакомых по переписке?\r\nХочется лёгкой непринуждённой беседы или наоборот, излить душу и рассказать о проблемах, не у кого просить совета?\r\nХочешь узнать через переписку какую-либо информацию о человеке, но стесняешься сам(а) спросить?\r\nХочешь узнать, флиртует ли твой парень/твоя девушка по переписке с другими людьми и способен(-на) ли он(а) к измене?\r\n\r\nТогда обращайся ко мне!', 'Если хотите, чтобы я переписывалась с другим человеком, сразу', 33, 1, '', 0, '1351007924', '2012-10-23', '1', '', 0, 1411, '46.72.233.109', '194-1.jpg', '', '', 100, 0, 20, '1748745'),
(195, 367, 'Нарисую Ваш портрет векторной графикой', 'портрет, нарисую, векторная графика', 'Нарисую Ваш портрет по фотографии, или что нибудь другое, используя редактор векторной графики.', 'Вы должны отправить мне фотографию', 22, 1, '', 0, '1351018854', '2012-10-23', '1', '', 0, 1537, '77.73.139.76', '195-1.jpg', '195-2.jpg', '195-3.jpg', 100, 0, 20, '1755206'),
(196, 368, 'расскажу о продвижении паблика ВК', 'ВК, вконтакте, паблик, раскрутка, продвижение, лайки', 'Я расскажу вам о том, как добавлять по несколько тысяч человек за неделю в группы/паблики ВК совершенно бесплатно!\r\nПолучать много лайков или друзей не тратя ни копейки!', 'Готовность чётко следовать инструкциям', 29, 1, '', 0, '1351081051', '2012-10-24', '1', '', 0, 1595, '89.178.222.147', '196-1.jpg', '', '', 100, 0, 20, '1758485'),
(197, 334, 'отвечу на любые вопросы по ebay', 'ebay ебей покупки', 'Посоветую какой почтой лучше отправлять, расскажу про сроки доставки разных стран, как быть с таможней и тд.', 'Задайте вопрос', 29, 1, '', 0, '1351509330', '2012-10-29', '1', '', 0, 1245, '178.177.43.80', '197-1.jpg', '', '', 100, 0, 20, '1811203');
