(198, 334, 'создам музыкальный сборник', 'музыка сборник сон расслабление слушать музыку ', 'Я создам индивидуальный музыкальный сборник из 50 песен. Это может быть дневной, для делания чего-то дома, как музыкальный фон, утренний, когда Вы только встали и собираетесь на работу/учебу, вечерний, сборник для сна, расслабляющий, под который Вы легко сможете уснуть, да какой угодно, главное знать время суток! ', 'Нужно только сказать в какое время суток будет прослушиваться сборник и он будет готов. Остальные пожелания на Ваше усмотрение :)', 34, 2, '', 0, '1351509546', '2012-10-29', '1', '', 0, 1381, '178.177.43.80', '198-1.jpg', '', '', 100, 0, 20, '1811202'),
(203, 391, 'Я профессионально обработаю 1 фотографию', 'Фотография, Photoshop', 'Предлагаю свои услуги по профессиональной обработке фотографий (ретушь, цветокоррекция, баланс белого, контраст, резкость, грейдинг, обтравка, фотомонтаж, коллажирование, кадрирование, и др). Ответственность, обязательность. Быстрота и качество исполнения. Креативный подход.', 'Фотографии', 22, 1, '', 0, '1355610410', '2012-12-15', '1', '', 0, 1523, '31.23.178.168', '203-1.jpg', '203-2.jpg', '203-3.jpg', 100, 0, 20, '2464985'),
(204, 391, 'могу создать слайдшоу', 'Слайдшоу, фотография, видео', 'Предлагаю свои услуги по созданию слайдшоу. Я сделаю видеоклип из ваших фото, на ролик будет наложена любая музыка, различные эффекты, необходимая стилистика. Это прекрасное признание в любви любимому человеку, подарок родным, друзьям, имениннику или молодожёнам! Ответственность, обязательность. Быстрота и качество исполнения. Креативный подход. ', 'Фотографии', 23, 2, '', 0, '1355610597', '2012-12-15', '1', '', 0, 1713, '31.23.178.168', '204-1.jpg', '', '', 100, 0, 20, '2464984'),
(205, 391, 'сделаю монтаж видеоролика', 'Видео монтаж', 'Предлагаю свои услуги по профессиональному монтажу, добавлю музыку, наложу эффекты ,текст и др. Примеры моих работ https://vimeo.com/user9077223 Ответственность, обязательность. Быстрота и качество исполнения. Креативный подход.', 'Видео', 23, 2, '', 0, '1355611109', '2012-12-15', '1', '', 0, 1794, '31.23.178.168', '205-1.jpg', '', '', 100, 0, 20, '2464983'),
(206, 391, 'предлагаю свои услуги по набору рукописного/сканированного текста 2 листа ', 'Набор текста', 'Аккуратно, грамотно и быстро набираю рукописный/сканированный текст. Быстрота и качество исполнения.', 'Текст', 33, 1, '', 0, '1355611351', '2012-12-15', '1', '', 0, 1378, '31.23.178.168', '206-1.jpg', '', '', 100, 0, 20, '2464982'),
(207, 391, 'предлагаю свои услуги по конвертации любых форматов', 'Конвертация', 'Предлагаю свои услуги по конвертации любых форматов: видео(avi, flv, mts, mpeg, mkw, swf и тд), фото (jpeg, tiff, raw, bmp, и тд), текстовых документов(pdf, fb2, Rtf, odt, doc) и др.  Быстрота и качество исполнения.', 'Ссылки', 31, 1, '', 0, '1355611512', '2012-12-15', '1', '', 0, 1419, '31.23.178.168', '207-1.jpg', '', '', 100, 0, 20, '2464981'),
(208, 391, 'могу скачать видео с любого сайта', 'Видео', 'Я скачаю для вас видео с любого сайта в интернете (VKontakte, YouTube, RuTube, vimeo.ru и др). Вам останется только скачать его с файлообменника. Быстрота и качество исполнения.', 'Ссылки', 29, 1, '', 0, '1355611716', '2012-12-15', '1', '', 0, 2330, '31.23.178.168', '208-1.jpg', '', '', 100, 0, 20, '2464980'),
(209, 391, 'выполню все виды дизайна', 'Дизайн', 'Предлагаю свои услуги по любым видам графического дизайна. Визитки , листовки, буклеты, логотипы, шапки, меню вконтакте, флаера, афиши, плакаты, картинки, обработка фото, видео, кнопки, аватарки и т.д.Векторная и растровая графика. Цена зависит от сложности заказа и объема работы.  Ответственность, обязательность. Быстрота и качество исполнения. Креативный подход. ', 'Материал', 22, 3, '', 0, '1355611979', '2012-12-15', '1', '', 0, 1416, '31.23.178.168', '209-1.jpg', '', '', 100, 0, 20, '2464979'),
(210, 391, 'сделаю сайт &quot;под ключ&quot;', 'Сайт', 'Предлагаю свои услуги по созданию профессионального, красивого и функционального сайт под ключ. Дизайн, верстка, CMS. За дополнительную плату наполнение контентом, раскрутка.  Ответственность, обязательность. Быстрота и качество исполнения. Креативный подход. \r\n', 'Проект', 27, 7, '', 0, '1355612341', '2012-12-15', '1', '', 0, 2076, '31.23.178.168', '210-1.jpg', '', '', 100, 0, 20, '2464977'),
(211, 394, 'сделаю проф. ретушь и простую реставрацию', 'ретушь, реставрация.', 'Ретушь фотографий, портретное фото.\r\nПростая реставрация старых фото. \r\nПростые задания по дизайну. ', 'Для ретуши, фото качественное, а не с мобильника.', 22, 1, '', 0, '1355664110', '2012-12-16', '1', '', 0, 1560, '93.72.99.162', '211-1.jpg', '', '', 100, 0, 20, '2472930'),
