(229, 420, 'Подарю 15 ecovers в формате PSD для Ваших электронных книг ', 'Графика,3D обложки', 'Элементы дизайна можно перетаскивать из одной обложки в другую, т.е. комбинировать и делать бесконечное число УНИКАЛЬНЫХ обложек.Либо просто вставляйте свой текст.\r\nПосмотреть можно здесь: http://s2.micp.ru/5hfc9.png\r\n', '100 рублей', 22, 2, '', 0, '1360039543', '2013-02-04', '1', '', 0, 1382, '188.44.101.89', '229-1.png', '', '', 100, 0, 20, '2922135'),
