(442, 805, 'могу посоветовать что подарить', 'помощь в подарке ', 'Я могу посоветовать что подарить\r\n ( Так как я много времени провожу на разных сайтах о подарках, а так же учусь на дизайнера, то с удовольствием помогу вам понять,что же кому подарить. Обращайтесь!)', ' Вам нужно будет рассказать о том человеке, которому вы выбираете подарок. О том что ему нравится и наоборот.', 16, 2, '', 0, '1417521743', '2014-12-02', '1', '', 0, 47, '83.149.8.165', '442-1.png', '', '', 100, 0, 20, '6837610'),
