(218, 406, 'могу сделать лого для сайта', 'photoshop', 'Могу сделать лого в фотошопе, очень качественно. Лого может быть создан для сайта и для многого другого. ', 'От покупателя нужно только описания продукта для которого я сделаю лого!', 22, 2, '', 0, '1357161667', '2013-01-02', '1', '', 0, 1897, '5.56.112.212', '218-1.png', '218-2.png', '', 100, 0, 20, '2614651'),
