(246, 460, 'сделаю каталожную обтравку 10 фото (уберу фон) за 100 рублей. На выходе eps, tiff, psd, png, jpg. ', 'контур каталожная обтравка outline вырезать удалить обработка фон фото фотография изображение ', 'Выполню обтравку товара на фото. Фон либо убирается вообще (прозрачность в png, gif, psd - файлах), либо замена на любой однотонный (RGB, CMYK), либо изображение возвращается в неизменном виде, но с добавлением контура, который в дальнейшем позволит самостоятельно определить и отредактировать вид обтравки.\r\n100 рублей за 10 фото с несложным контуром (внешняя обтравка + 2-3 области внутри) или за 5 фото со сложным (больше 3 внутр. областей).', 'С вас фото товара в хорошем качестве. Если при 100% увеличении контуры товара нечеткие - качество не считается хорошим. Если один товар на одной фото состоит из нескольких элементов (с насадками, аксессуарами), контур считается сложным.\r\nФайлы с готовой обтравкой предоставляются только в одном выбранном формате. Дополнительный формат считается как отдельный заказ.\r\nСовмещение в одном заказе и простых, и сложных контуров не допускается.', 22, 1, '', 0, '1366874360', '2013-04-25', '1', '', 0, 1618, '176.14.36.191', '246-1.jpg', '', '', 100, 0, 20, '3598056'),
