(268, 500, 'Я могу Научить тайной практической магии ордена Тамплиеров (богатство) ', 'колдовство, практика, магия, богатство', 'Во все времена человек мечтает привлечь к себе деньги, успех, богатство. Для выполнения этой миссии существуют миллионы способов, заговоров. Обрядов. Одним из самых простых, но в тоже время самых действенных является магнит для денег из доллара, выглядит он. Как треугольник из купюры, а о том, как свернуть доллар треугольником, чтобы привлечь к себе деньги расскажем ниже.', ' Инструкция по созданию магнита для денег.\r\n 1. Определитесь с положением луны в день, когда собираетесь создавать магнит, как и все магические действия на удачу и по привлечению денег, такие ритуалы лучше проводить на растущую луну. Разобравшись с луной, беремся за купюру, лучше всего подойдет бумажка с изображением Джорджа Вашингтона. Разворачиваем ее лицом президента вверх, верх купюры должен быть справа, а низ &ndash; слева.\r\n 2. Теперь собственно о том, как свернуть доллар треугольником: верхний угол купюры сгибаем к правому\r\n ее краю. После этого у нас получается некий треугольник, вершину этого образовавшегося треугольника загибаем в себе, чтобы снова получился прямоугольник, теперь сворачиваем купюру по диагонали. Вспоминаем школьный курс геометрии и заворачиваем гипотенузу образовавшегося треугольника внутрь. После этих действий вы должны увидеть перевернутое слово &laquo;one&raquo;, ели вы его видите &ndash; значит все правильно. В сумме у вас должно получить три сложения. \r\n3. Теперь оставшиеся нижние углы загибаем к основанию полученного треугольника и аккуратно заворачиваем внутрь, скрепляя при этом сами слои бумаги. Это самый простой и надежный способ свернуть купюру треугольником, или скорее пирамидкой &ndash; именно так выглядит магнит для денег.\r\n 4. Чтобы убедиться в правильности сложения, переверните получившуюся фигурку, и перед вами будет пирамида с оком на вершине, изображенная на обороте доллара. Если вы видите этот знак масонов, значит треугольник собран правильно. Именно пирамида является лицевой стороной магнита-треугольника, она и должна всегда быть сверху.\r\n 5. Теперь на купюру читаются заговоры для привлечения денег. Какой из заговоров читать &ndash; выбирать вам, главное, чтобы вы в него верили. \r\nМожно обойтись и без заговоров, просто поднесите треугольник к губам и попросите его привлекать деньги. Скажите, что он магнит для денег и за ним в дом придут миллионы похожих купюр. Сам треугольник нужно всегда носить в кошельке, лицевой стороной (то есть пирамидой масонов) к себе. Больше эту купюру не вынимайте,  главное &ndash; не разворачивайте.\r\nСамое важное- нанесите черным фломастером пентограмму на пирамиду в купюре\r\nзаговор читайте на латыни', 33, 1, '', 0, '1373609380', '2013-07-12', '1', '', 0, 1210, '37.57.61.88', '268-1.jpg', '268-2.jpg', '268-3.png', 100, 0, 20, '4020033'),
(269, 501, 'напишу статью, рецензию, очерк. Отредактирую и откорректирую текст любой сложности', 'Написание текстов, копирайтинг, редактирование', 'Могу написать как статью для главной страницы сайта, так и для разделов. Осуществляю редактирование и корректировку написанного Вами текста. Цена фиксированная - 100 рублей за 1000 знаков. \r\nВозможно полное наполнение Вашего сайта : статьи, обзоры, лента новостей и т.д.', 'От покупателя требуется четко оформленное задание, с указанием всех необходимых ему критериев, а также своевременная оплата проделанной работы.', 33, 1, '', 0, '1373725203', '2013-07-13', '1', '', 0, 1372, '213.87.122.218', '269-1.jpg', '', '', 100, 0, 20, '4023452'),
