(294, 540, 'сделаю для вас персональную программу тренировок', 'программа тренировок, бодибилдинг, программа питания, похудение', 'Я сделаю для вас персональную программу тренировок по фитнесу или бодибилдингу за 100 рублей.\r\n\r\nПрограмма тренировок будет расписана на 3 месяца вперед и будет предоставлена в формате Excel. Для всех упражнений будут предоставлены ссылки на видео примеры.\r\n', 'Пожалуйста пришлите мне: вашу цель (конкретно: похудеть, увеличить силу, увеличить жим лежа, кубики пресса и т.д.), вашу текущую программу тренировок (если есть), ваш вес, возраст, имеющиеся травмы.', 29, 2, '', 0, '1380880567', '2013-10-04', '1', '', 0, 795, '188.175.95.160', '294-1.jpg', '', '', 100, 0, 20, '4291291'),
(295, 302, 'расскажу, как играть беспроигрышно на спортивных ставках', 'беттинг, спортивные ставки', 'Что-нибудь слышали о вилках и бонусах у букмекеров? Если нет, то расскажу и научу, как на этом заработать не проигрывая! Вкратце, есть букмекер и есть биржа ставок. Можно &quot;переливать&quot; средства из одной конторы в другую, тем самым намывая себе золотишко. Информация стоит гораздо больше, чем за неё здесь прошу, будут дополнительные необременительные условия. Если заинтересовались, пожалуйста связывайтесь. 18+ только.', '18+', 30, 5, '', 0, '1381018040', '2013-10-05', '1', '', 0, 764, '84.23.46.189', '295-1.jpg', '', '', 100, 0, 20, '4296108'),
(296, 302, 'помогу настроить компьютер или программу удалённо', 'вирусы, компьютер, рабочий стол, лечение вирусов, установка программ', 'Если у Вас есть сложность с установкой программы или нужно вылечить вирус на компьютере, сайте, то помогу Вам сделать это удалённо. Быстро и безопасно. Подскажу тонкости.', 'Что Вам нужно сделать? Опишите подробнее пожалуйста. ', 31, 5, '', 0, '1381018197', '2013-10-05', '1', '', 0, 878, '84.23.46.189', '296-1.jpg', '', '', 100, 0, 20, '4296107'),
