(395, 705, 'создам презентацию', 'презентация, видео, PowerPoint, лекции, выступления, мероприятие', 'Если у Вашей компании нет презентации &ndash; это не беда, я Вам помогу. Создам презентацию любого бизнеса, мероприятия, лекции по Вашим пожеланиям, за умеренную плату. \r\nСоставление презентаций, в Power Point (активные ссылки, таблицы, диаграммы, графики, вставка звука),при наличии материалов - от 100 руб. за слайд. При подборе материалов, цена договорная.', 'Составление презентаций, в Power Point (активные ссылки, таблицы, диаграммы, графики, вставка звука), при наличии материалов - от 100 руб. за слайд. При подборе материалов, цена договорная.\r\n\r\nТайна обращения гарантирована, поэтому все свои работы высылаю ТОЛЬКО заказчикам. После сдачи проекта все работы уничтожаются. В связи с этим, образцы своих работ не высылаю.', 30, 10, '', 0, '1405082827', '2014-07-11', '1', '', 0, 275, '193.238.116.72', '395-1.jpg', '', '', 100, 0, 20, '6097094'),
