(433, 790, 'обработаю 2 фотографии ', 'фотошоп photoshop обработка фото', 'Отлично владею программами Adobe Photoshop и Lightroom. \r\nРетушь фото, художественная ретушь цветокоррекция, ретушь кожи.\r\nПроходила множество курсов по фотографии и их обработке. Постоянно поднимаю уровень и  совершенствуюсь.\r\nОбращайтесь на почту: todd.tolkien@gmail.com', 'Качественные исходники (не фото с телефона).', 22, 2, '', 0, '1416021756', '2014-11-14', '1', '', 0, 91, '95.153.177.115', '433-1.jpg', '433-2.jpg', '433-3.jpg', 100, 0, 20, '6731254');
INSERT INTO `posts` (`PID`, `USERID`, `gtitle`, `gtags`, `gdesc`, `ginst`, `category`, `days`, `youtube`, `feat`, `time_added`, `date_added`, `active`, `last_viewed`, `rating`, `viewcount`, `pip`, `p1`, `p2`, `p3`, `price`, `rev`, `ctp`, `short`) VALUES
(431, 784, 'найду любую информацию об аниме и японской поп-культуре в целом.', 'поиск аниме Япония', 'Найду для вас почти что угодно о японской поп-культуре, аниме, J&minus;POP и играх.', 'Просто скажите, что вас интересует и я подробно расскажу об этом.', 29, 1, '', 0, '1415092860', '2014-11-04', '1', '', 0, 83, '79.164.51.59', '431-1.jpg', '', '', 100, 0, 20, '6650731'),
(432, 785, 'переведу 1000 знаков текста любой сложности(англ.,нем.,франц,) ', 'перевод переводчик текст английский ', 'Готов брать большие объемы текста любой сложности с/на англ., франц. и нем. языки.\r\nПроф.переводчик. Ссылка на профиль и портфолио\r\nhttps://www.fl.ru/users/nazarleeText/', 'Оплата перевода.', 33, 1, '', 0, '1415189373', '2014-11-05', '1', '', 0, 104, '46.119.211.251', '432-1.jpg', '', '', 100, 0, 20, '6655400'),
(434, 790, 'сделаю аватар для Вконтакте', 'фотошоп вконтакте аватар', 'Для группы или страницы с любой тематикой.\r\nПредоплата 50%\r\nОбращаться по почте: todd.tolkien@gmail.com', '.', 22, 2, '', 0, '1416021961', '2014-11-14', '1', '', 0, 89, '95.153.177.115', '434-1.jpg', '', '', 100, 0, 20, '6731252'),
(435, 790, 'наполню вашу группу Вк контентом', 'контент вконтакте администрирование ', '10 абсолютно уникальных постов оформленных в виде вики страниц (возможно дальнейшее сотрудничество) для вашей группы.\r\nКачественные фотографии с платных фотостоков,  текст с уникальность до 95%, подбор интересных и актуальных новостей на сегодняшний день по тематике группы.\r\nПредоплата 50%\r\nОбращаться по почте: todd.tolkien@gmail.com', 'Обращайтесь на почту: todd.tolkien@gmail.com', 34, 2, '', 0, '1416022465', '2014-11-14', '1', '', 0, 100, '95.153.177.115', '435-1.jpg', '', '', 100, 0, 20, '6731251'),
(436, 790, 'прокачаю технику в WoT ', 'wot world of tanks игры помощь прокачка', 'Помогу прокачать танк 1-5 уровня (например с Pz. 1 C до Luchs) и сохранить хорошую статистику.\r\nИмею 15k боев, 53%+, кпд 1200+, два топа (успешно выкачано более 152 танков, так как 10лвл не были приоритетом).\r\nС большим удовольствием прокачаю танки немецкой ветки (но не откажусь и от прокачки техники других наций).\r\n-\r\nПредоплата 50%\r\nОбращаться по почте: todd.tolkien@gmail.com', 'Предоплата 50%', 33, 1, '', 0, '1416023431', '2014-11-14', '1', '', 0, 105, '95.153.177.115', '436-1.jpg', '', '', 100, 0, 20, '6731250'),
(437, 792, 'помогу вам найти работу или квартиру', 'работа квартира поиск ', 'Помогу Вам найти работу или квартиру в Вашем городе за короткие сроки. Есть своя база.', 'От Вас потребуется:\r\n1. Какая работа Вас интересует?\r\n2. В пределах какой суммы?\r\n3. В каком районе?\r\n4. Любые Ваши замечания по поиску.', 33, 1, '', 0, '1416206440', '2014-11-17', '1', '', 0, 119, '213.87.136.162', '437-1.png', '', '', 100, 0, 20, '6751630'),
(443, 805, 'могу написать стихотворение о любви', 'Стихи о любви', 'Только о любви', 'напишите вашу историю любви', 16, 4, '', 0, '1417525181', '2014-12-02', '1', '', 0, 53, '83.149.8.165', '443-1.jpg', '', '', 100, 100, 20, '6839102'),
(444, 805, 'могу отредактировать фотографию (2)', 'редактировать фотографии', 'Редактирую фотографии ,не профессионально', 'Пришлите фото', 22, 3, '', 0, '1417525358', '2014-12-02', '1', '', 0, 52, '83.149.8.165', '444-1.jpg', '', '', 100, 0, 20, '6839101'),
(445, 805, 'могу посоветовать сериал или фильм', 'советую фильмы и сериалы', 'Под ваше настроение', '.', 29, 2, '', 0, '1417526370', '2014-12-02', '1', '', 0, 50, '83.149.8.165', '445-1.png', '', '', 100, 0, 20, '6839100'),
(446, 805, 'создам презентацию ', 'презентация', 'В Power Point', 'С вас тема', 32, 5, '', 0, '1417526547', '2014-12-02', '1', '', 0, 47, '83.149.8.165', '446-1.png', '', '', 100, 0, 20, '6839098'),
(447, 806, 'разработаю дизайн визитки, флаера', 'дизайн визиток', 'Разработка дизайна визиток, флаеров, дисконтных карт без обрисовки логотипа', 'полная корректная информация, необходимая для размещения на визитке, карте, флаере (адреса, фио, логотипы в векторе, доп. текст (слоган, информация о представляемом продукте, о которой хочется сообщить на визитке, карте)), желаемые изображения или фото.', 22, 1, '', 0, '1417528551', '2014-12-02', '1', '', 0, 61, '212.21.11.138', '447-1.jpg', '', '', 100, 0, 20, '6838065'),
(448, 808, 'найду любую информацию в интернете', 'интернете, объявления, работа на дому.', 'Предоставлю информацию которая интересует и нет возможности искать самому. Размещу объявления в интернете.', 'Предоставить конкретную информацию по возможности.', 27, 2, '', 0, '1417613473', '2014-12-03', '1', '', 0, 68, '188.163.71.181', '448-1.jpg', '', '', 100, 0, 20, '6840876'),
(449, 810, 'составлю качественый прогноз на спорт', 'Спорт, Ставки, Совет', 'Составляю прогнозы на спорт с 90% увереностью проходимости коэф от 1.5. Составляю только те прогнозы в которых уверен.', 'От покупателя требуется только оплатить прогноз))', 29, 1, '', 0, '1417682699', '2014-12-04', '1', '', 0, 49, '80.240.216.182', '449-1.jpg', '', '', 100, 0, 20, '6845614'),
(450, 811, 'наберу любой текст до 3000 знаков, помогу с русским языком', 'набор текста', 'разборчивый рукописный текст переведу в электронный вариант. Или помогу школьникам и студентам выполнить задание по русскому языку.', 'Четко формулируйте  задание. Присылайте файлы на электронную почту, с обратным адресом и телефоном.', 33, 3, '', 0, '1417700224', '2014-12-04', '1', '', 0, 55, '188.254.110.94', '450-1.jpg', '', '', 100, 0, 20, '6845694'),
(451, 811, 'дам профессиональный совет по воспитанию детей', 'воспитание ребенка', 'помогу разобраться в сложной ситуации, связанной с воспитанием вашего ребенка, дам несколько полезных советов', 'Поделитесь своей проблемой ', 29, 2, '', 0, '1417703443', '2014-12-04', '1', '', 0, 52, '188.254.110.94', '451-1.jpg', '', '', 100, 0, 20, '6846261'),
(452, 29, 'пришлю Вам открытку из берлина или бохума', 'открытка берлин почта подарок сюрприз', 'Пришлю открытку из Берлина или из Бохума', 'адрес, куда посылать', 26, 2, '', 0, '1418073207', '2014-12-08', '1', '', 0, 54, '85.178.74.65', '452-1.jpg', '', '', 100, 0, 20, '6866359'),
(453, 820, 'напишу стихи на любую тему, 2 четверостишья ', 'стихи, поздравления', 'Я напишу стихи на любую тему, 2 четверостишья за 100 рублей. Поздравления, любовные и т.д.', 'Пожалуйста, подробно опишите человека, которому посвящаются стихи.', 16, 1, '', 0, '1418843723', '2014-12-17', '1', '', 0, 19, '85.115.248.220', '453-1.jpg', '', '', 100, 0, 20, '6905159'),
(454, 820, 'применю волшебные эффекты к вашим фото (5 штук)', 'картинка, фото, фотошоп, красота', 'Я отредактирую ваши фото или применю к ним волшебные эффекты (5 штук), сделаю их красивыми и незабываемыми.', 'Пожалуйста, пришлите мне ваши фото, которые желаете отредактировать и ваши пожелания.', 22, 1, '', 0, '1418844411', '2014-12-17', '1', '', 0, 25, '85.115.248.220', '454-1.jpg', '', '', 100, 0, 20, '6905158'),
(455, 821, 'Отправлю Новогоднее именное видеопоздравление от Деда Мороза', 'видеопоздравление, именное видеопоздравление', 'С экрана добрый Дед Мороз несколько раз обращается к ребенку по имени и заводит интерактивную беседу с ним, знакомит с персонажами и поздравляет с Новым годом. Юный зритель становится главным \r\nгероем сказки: отгадывает загадки, помогает зажечь ёлку и многое другое. Ребенок будет в восторге от подарка!\r\nПример:\r\nhttp://www.youtube.com/watch?v=THEW0S42GBQ\r\n\r\nПо всем вопросам: present@dm-video.ru', 'Напишите, для какого имени нужно поздравление. В базе более 360 имен!', 16, 1, '', 0, '1418904706', '2014-12-18', '1', '', 0, 28, '109.165.18.183', '455-1.jpg', '', '', 100, 0, 20, '6907918'),
(456, 823, 'помогу настроить utorrent на максимальную скорость.', 'utorrent', 'Помогу настроить utorrent 1.8.2 на максимальную скорость. (Windows xp/7, utorrent от 1.8.2) ', 'мне нужно: \r\n1) ваша ос \r\n2) ваша версия utorrent', 33, 1, '', 0, '1419052331', '2014-12-20', '1', '', 0, 15, '95.24.94.82', '456-1.png', '', '', 100, 0, 20, '6912420'),
(457, 823, 'помогу создать резервную копию вашей системы с помощью acronis true image.', 'acronis безопасность система ', 'Помогу создать резервную копию вашей системы и  создать скрытый раздел на любом из ваших дисков на котором она будет размещаться.', 'мне нужно\r\n1) знать вашу ос', 32, 1, '', 0, '1419052787', '2014-12-20', '1', '', 0, 14, '95.24.94.82', '457-1.png', '', '', 100, 0, 20, '6912419'),
(458, 824, 'напишу сочинение', 'Написать готовое сочинение школа школьный студент', 'Напишу сочинение на любую школьную тему: книга, фильм, картина, историческое событие, известная личность и многое многое другое. \r\nГарантирована уникальность текста и грамотность написания.\r\n', 'Желательно предоставить план для быстрейшего результата, но не обязательно.', 33, 1, '', 0, '1419104879', '2014-12-20', '1', '', 0, 12, '94.255.94.199', '458-1.png', '', '', 100, 0, 20, '6910346'),
(459, 824, 'продам все варианты ГИА по математике', 'ГИА ОГЭ Экзамен Тестирование Тесты Варианты Вариант Пробники Школа 9 класс', 'Варианты 101-730. \r\nСмело используйте для тренировки перед ГИА (ныне ОГЭ). Много варианов, будете знать чего ожидать. И еще, это НЕ решебник или помощник, это всего-лишь сборник вариантов. ', 'Желание учиться...  шучу, с вас только 100 рублей :)', 33, 1, '', 0, '1419105515', '2014-12-20', '1', '', 0, 14, '94.255.94.199', '459-1.png', '', '', 100, 0, 20, '6910345'),
(460, 825, 'Сделаю красивую визитку, листовки, открытки, грамоты, обраотку фото, реставрацию старых фото, смешную обработку фото ', 'Визитки, листовки, открытки, обработка фото, реставрация ', 'Обработка фотографий, реставрация старых фото, дизайн визиток, открыток, буклетов, листовок', 'Мне требуется чёткая формулировка требований к заказу, так же нужно прислать логотипы или знаки которые должны присутствовать на вашем заказе. Фотографии которые нужно обработать... сканер старых фото для реставрации. ', 22, 2, '', 0, '1419203252', '2014-12-21', '1', '', 0, 22, '178.163.99.5', '460-1.jpg', '', '', 100, 0, 20, '6916160');
